import drag from './drag'
// tsc .\src\directives\cubeDrag\drag.ts  --target ES2016

const install = function(Vue) {
  Vue.directive('cube-drag', drag)
}

if (window.Vue) {
  window.drag = drag
  Vue.use(install) // eslint-disable-line
}

drag.install = install
export default drag
